import React, {Component} from 'react'
import {Container, Row, Col}  from 'react-bootstrap'

import Schedule from './Schedule'

class LoadFrench extends Component{

    render(){
        return (
            <div>
                <Container>
                    <Row>
                        <Col>
                            <Schedule/>
                        </Col>
                    </Row>
                </Container>
            </div>
        )
    }
}

export default LoadFrench
